import 'bootstrap/dist/css/bootstrap.min.css'

const HomePage = () => {

    return (
        <div>
            <div>
                <div className="d-flex justify-content-center" style={{paddingTop:'5px'}}>
                    <input name="doctor_search" 
                    type="text" 
                    placeholder="Search for doctors"
                    style={{width: '80%'}}
                    />
